import org.apache.commons.io.IOUtils
import java.net.URL
import java.nio.charset.Charset

// Zeppelin creates and injects sc (SparkContext) and sqlContext (HiveContext or SqlContext)
// So you don't need create them manually

// load local Air Quality data
val NO2Text = sc.textFile("/home/rs/sharef/hgfs/shared/CMPE272/ECP/ad_viz_plotval_data.csv")


case class AirQ_NO2(Date: String, AQS_SITE_ID: String, POC: Integer, Daily_Max_1_hour_NO2_Concentration: Float,Daily_Air_Qualitiy_index: Float, DAILY_OBS_COUNT: Integer)
//, DAILY_AQI_VALUE:Integer, DAILY_OBS_COUNT: Integer, PERCENT_COMPLETE: Float, AQS_PARAMETER_CODE: String)

val Air_NO2= NO2Text.map(s => s.split(",")).filter(s => s(0) != "\"Date\"").map(
    s => AirQ_NO2(s(0).replaceAll("\"", ""), 
            s(1).replaceAll("\"", ""),
            s(2).replaceAll("\"", "").toInt,
            s(3).replaceAll("\"", "").toFloat,
            s(5).replaceAll("\"", "").toFloat,
            s(6).replaceAll("\"", "").toInt
        )).toDF()
Air_NO2.registerTempTable("Air_NO2")
Air_NO2.show();

%sql 
select Daily_Air_Qualitiy_index, Daily_Max_1_hour_NO2_Concentration
from Air_NO2 
where DAILY_OBS_COUNT > 21
and  Daily_Air_Qualitiy_index > ${MinValue =30} 
and AQS_SITE_ID = ${SiteID = "060850005","060850005"|"060850006"}

%sql 
select Date, Daily_Air_Qualitiy_index,Daily_Max_1_hour_NO2_Concentration
from Air_NO2 
where DAILY_OBS_COUNT > 21
and  Daily_Max_1_hour_NO2_Concentration > ${MinValue =30} 
and AQS_SITE_ID = ${SiteID = "060850005","060850005"|"060850006"}
